  "Allegations" : "6/27/96 STIPULATION AND CONSENT TO PENALTY FILED BY NYSE DIVISION OF ENFORCEMENT AND PENDING. CONSENTED TO FINDINGS: WITHOUT ADMITTING OR DENYING GUILT, CAMP CONSENTS TO: 1. FINDING BY THE HEARING PANEL THAT HE: A. ENGAGED IN CONDUCT INCONSISTENT WITH JUST AND EQUITABLE PRINCIPLES OF TRADE BY: (I) EFFECTING TRANSACTIONS IN THE ACCOUNT OF A CUSTOMER OF HIS MEMBER ORGANIZATION EMPLOYER THAT WERE UNSUITABLE IN VIEW OF SUCH CUSTOMER'S INVESTMENT OBJECTIVES, INVEST- MENT EXPERIENCE, AND THE FINANCIAL RESOURCES IN SUCH CUSTOMER'S ACCOUNT; (2) EFFECTING UNAUTHORIZED TRADES IN THE ACCOUNTS OF CUSTOMERS OF HIS MEMBER ORGANIZATION EMPLOYER; (3) EFFECTING TRADES IN THE ACCOUNT OF A CUSTOMER OF HIS MEMBER ORGANIZATION EMPLOYER THAT WERE EXCESSIVE IN VIEW OF THE CUSTOMER'S ACCOUNT; AND (4) FAILING TO FOLLOW THE INSTRUCTIONS OF A CUSTOMER OF HIS MEMBER ORGANIZATION EMPLOYER NOT TO PURCHASE SECURITIES OF COMPANIES IN CERTAIN INDUSTRIES AND NOT TO USE MARGIN EXCEPT ON A SHORT-TERM BASIS. B. VIOLATED EXCHANGE RULE 408(A) BY EXCERCISING DISCRETIONARY POWER IN A CUSTOMER'S ACCOUNT WITHOUT FIRST OBTAINING PROPER WRITTEN AUTHORIZATION OF THE CUSTOMER. C. VIOLATED EXCHANGE RULE 408(B) BY EXCERCISING DISCRETIONARY POWER IN A CUSTOMER'S ACCOUNT WITHOUT FIRST NOTIFYING AND OBTAINING THE APPROVAL OF ANOTHER PERSON DELEGATED UNDER EXCHANGE RULE 342(B) (1) WITH AUTHORITY TO APPROVE THE HANDLING OF SUCH ACCOUNTS. D. VIOLATED EXCHANGE RULE 408(B) BY FAILING TO IDENTIFY ORDERS ENTERED ON A DISCRETIONARY BASIS AS DISCRETIONARY ON THE ORDER TICKETS AT TH TIME OF ENTRY. E. VIOLATED EXCHANGE RULE 724(A) BY EXCERCISING DISCRETIONARY POWER WITH RESPECT TO TRADING IN OPTION CONTRACTS IN THE ACCOUNT OF A CUSTOMER OF HIS MEMBER ORGANIZATION EMPLOYER WITHOUT THE PROPER WRITTEN AUTHORIZATION OF THE CUSTOMER AND WITHOUT OPTAINING THE WRITTEN APPROVAL OF THE REGISTERED OPTIONS PRINCIPAL. 2. THE IMPOSITION BY THE EXCHANGE OF THE PENALTY OF A CENSURE AND A SUSPENSION *See FAQ #1*",
